## make some predictions

def make_prediction_one_prediction(path_image,model):
    tensorImage = getTensorfromImagePath(path_image)
    tensorNew = tensorImage.unsqueeze(0)
    tensorNew = tensorNew.to(DEVICE)
    prediction = model(tensorNew)
    

    return torch.argmax(prediction).item()

